import React, { Component } from "react";
import CircleImage from "./CircleImage";

class IconRow extends Component {

  render() {
    const icons=[];
    let i=0;
    while (i!=this.props.icons.length){
        icons.push(this.props.icons.slice((this.props.icons.length/this.props.numRows)*i, (this.props.icons.length/this.props.numRows)*(i+1)));
        i++;
    }
    console.log(icons);
    return (
      <div className="skill-icons flex-row">
        {this.props.icons.map(icon=>(
            <CircleImage
            imageId={icon}
            imageSource={`./images/${icon}.png`}
            size={`${this.props.size}px`}
          />
        ))}
      </div>
    );
  }
}
export default IconRow;
